import './App.css';
import Button from '@mui/material/Button';


function App() {
  const date = new Date().toLocaleDateString();
  return (
    <div className="App">
      <Button variant='contained' color='success' onClick={() => {
          alert(date);
        }}
      >
      Tell the endpoint the current time</Button>
    </div>
  );
}

export default App;
